import axios from 'axios';

const getData = callback =>{
    try {
		const res = axios.get('http://localhost:9001/reports/list')
		callback(res.data)
	  } catch (error) {
		console.log(error.message)
	  }
};

const RenderReport = (checkInDate,checkOutDate, callback) => {

	try {
        const res =axios.get('http://localhost:9001/reports'
        ,
        { 
          params:{
            start: checkInDate, end: checkOutDate
          }
        }
        )
        callback(res.data)
      } catch (error) {
        console.log(error.message)
      }

};

export {getData, RenderReport};
